import React, { Component } from "react";

class Admin extends Component {
    render(){
        state = {
            loggedIn: false
        }
        if (this.state.loggedIn){
            return (
                <p>
                  Admin
                </p>

            );
        }else {
            return (
                <p>Please Log in!</p>
            )
        }
    }
}

export default Admin;
